import React from "react";
import FormLogin from "./form";
import "./styles.scss";
import "bootstrap/dist/css/bootstrap.min.css";

const Login = () => {
  return (
    <div className="login">
      <section className="login__section">
        <div className="col">
          <div className="col-md-12">
            <h1 className="login__section--title">
              Aplicación<br/>OLSoftware
            </h1>
          </div>
          <div className="col-md-12">
            <p className="login__section--subtitle">
              Prueba práctica Front-end senior
            </p>
          </div>
        </div>

        <div className="login__section--login">
        <div className="card-login">
          <Tittle text="Inicio de sesión" />
          <form className="Login" onSubmit={handleLogin} >
            <div class="form-group">
              <label className="icon-usuario"><FcIcons.FcBusinessman/></label>
              <Input              
              className="input-usuario"
                attribute={{
                  id: "usuario",
                  name: "usuario",
                  type: "text",
                  placeholder: "Usuario",
                }}
                handlechage={handleChange}
              />
              <p className="errorMsg"> {emailError}</p>
              <Input
              className="input-contrasena"
                attribute={{
                  id: "contrasena",
                  name: "contrasena",
                  type: "password",
                  placeholder: "contraseña",
                }}
                handlechage={handleChange}
                param={passwordError}
              />
              <p className="errorMsg"> {passwordError}</p>
            </div>
            <div className="btnContainer">
              <button className="btn btn-primary btnlogin" type="submit" >Iniciar sesión</button>
            </div>
          </form>
        </div>
        </div>
      </section>
    </div>
  );
};

export default Login;
